import React, {useState, useEffect} from 'react'

function App() {

  const [data,setData] = useState([{}])
  const [editedData,setEditedData] = useState([{}])

  useEffect(() => {
    fetch("/members").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  },[])

  const editArr = (num) => {
    setEditedData(num)
  }
  return (
    <div>
      {(typeof data.members === 'undefined') ? (
        <p>Loading...</p>
      ) : (
        data.members.map((member, i ) => (
          <div style={{ circle: { display: "flex", width: "100px", height: "100px", backgroundColor: "green", borderRadius: "50%",},  }} > 
          <button key={i} onClick={() => editArr(5)}>{member}</button>
          </div>

        ))
      )}
    </div>
  )
}

export default App
